// src/ChurnInsights.js
import React from 'react';
import './ChurnInsights.css';

const ChurnInsights = () => {
  return (
    <div className="churn-insights-container">
      <header className="churn-insights-header">
        <h1>Customer Churn Insights and Recommendations</h1>
        <p>Explore detailed insights and recommendations based on customer churn analysis.</p>
      </header>
      <div className="churn-insights-content">
        <section className="insights-section">
          <h2>Key Insights</h2>
          <ul>
            <li>High churn rates are observed among customers with low account balances.</li>
            <li>Frequent transactions are correlated with higher retention rates.</li>
            <li>Customer support interactions are a significant factor in customer satisfaction.</li>
          </ul>
        </section>
        <section className="recommendations-section">
          <h2>Recommendations</h2>
          <ul>
            <li>Implement targeted retention strategies for customers with low account balances.</li>
            <li>Enhance customer support services to address common issues more effectively.</li>
            <li>Offer personalized incentives to frequent transactors to increase loyalty.</li>
          </ul>
        </section>
      </div>
    </div>
  );
};

export default ChurnInsights;
